import "./App.css";
import Table from "./components/Table";

function App() {
  const data = [
    {
      id: 1,
      hostname: "host1.example.com",
      ip: "192.168.1.1",
      status: "Online",
    },
    {
      id: 2,
      hostname: "host2.example.com",
      ip: "192.168.1.2",
      status: "Offline",
    },
    {
      id: 3,
      hostname: "host3.example.com",
      ip: "192.168.1.3",
      status: "Online",
    },
    {
      id: 4,
      hostname: "host4.example.com",
      ip: "192.168.1.4",
      status: "Offline",
    },
    {
      id: 5,
      hostname: "host5.example.com",
      ip: "192.168.1.5",
      status: "Online",
    },
  ];

  return (
    <div className="root-container">
      <div className="main-container">
        <div>
          <h1 className="heading">Host Table</h1>
        </div>
        <Table data={data} />
      </div>
    </div>
  );
}

export default App;
